class userData{
    constructor() {
    var name="";
    }
    username(){
        var data = localStorage.getItem("admin");
        var data2 = JSON.parse(data);
        
        //var detials=JSON.parse( data2.data)
        var i = "";
        for (i in data2.data) {
          name=data2.data[i].fname;
          name += " "+data2.data[i].lname;
          console.log(name);
          return name;
        }
    }
}
export default userData;
